import React from 'react';
import image from '../assets/search-image.jpg';
import './ImageDisplay.css';

const ImageDisplay = () => {
  return (
    <div className="image-container">
      <img src={image} alt="search" className="image" />
    </div>
  );
};

export default ImageDisplay;
